import { FunctionComponent } from "react";
import { useFormik } from "formik";
import * as yup from "yup";

interface RegisterProps {}

const Register: FunctionComponent<RegisterProps> = () => {
  let formik = useFormik({
    initialValues: {
      firstName: "",
      middleName: "",
      lastName: "",
      phone: "",
      email: "",
      password: "",
      imageUrl: "",
      imageAlt: "",
      state: "",
      country: "",
      city: "",
    },
    validationSchema: yup.object({
      firstName: yup.string().required().min(2, "Please enter a valid name"),
      middleName: yup.string().min(2),
      lastName: yup.string().required().min(2, "Please enter a valid name"),
      phone: yup.string().required().min(6, "Please enter a valid Phone number"),
      email: yup.string().required().email(),
      password: yup
        .string()
        .required("Please Enter your password")
        .matches(
          /^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9]{4,})(?=.*[!@#\$%\^&\*]*-_)(?=.{8,})/,
          "Must Contain 8 Characters, One Uppercase, One Lowercase, at least 4 Numbers and One Special Case Character(!@#$%^&*-_*)"
        ),
      imageUrl: yup.string().required().url(),
      imageAlt: yup.string().required().min(2),
      state: yup.string(),
      country: yup.string().required(),
      city: yup.string().required(),
    }),
    onSubmit() {},
  });
  return (
    <>
      <h3 className="display-3">REGISTER</h3>

      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="firstName"
          placeholder="Your first name"
          name="firstName"
          value={formik.values.firstName}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="firstName">First Name</label>
        {formik.touched.firstName && formik.errors.firstName && (
          <small className="text-danger">{formik.errors.firstName}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="middleName"
          placeholder="Your middle name"
          name="middleName"
          value={formik.values.middleName}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="middleName">Middle Name</label>
        {formik.touched.middleName && formik.errors.middleName && (
          <small className="text-danger">{formik.errors.middleName}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="lastName"
          placeholder="Your lastName name"
          name="lastName"
          value={formik.values.lastName}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="lastName">lastName</label>
        {formik.touched.lastName && formik.errors.lastName && (
          <small className="text-danger">{formik.errors.lastName}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="phone"
          placeholder="phone"
          name="phone"
          value={formik.values.phone}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="lastName">phone</label>
        {formik.touched.phone && formik.errors.phone && (
          <small className="text-danger">{formik.errors.phone}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="email"
          className="form-control"
          id="floatingInput"
          placeholder="name@example.com"
          name="email"
          value={formik.values.email}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="floatingInput">Email address</label>
        {formik.touched.email && formik.errors.email && (
          <small className="text-danger">{formik.errors.email}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="password"
          className="form-control"
          id="password"
          placeholder="password"
          name="password"
          value={formik.values.password}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="password">password</label>
        {formik.touched.password && formik.errors.password && (
          <small className="text-danger">{formik.errors.password}</small>
        )}
      </div>

      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="imageUrl"
          placeholder="imageUrl"
          name="imageUrl"
          value={formik.values.imageUrl}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="imageUrl">image Url</label>
        {formik.touched.imageUrl && formik.errors.imageUrl && (
          <small className="text-danger">{formik.errors.imageUrl}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="imageAlt"
          placeholder="imageAlt"
          name="imageAlt"
          value={formik.values.imageAlt}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="imageAlt">image Alt</label>
        {formik.touched.imageAlt && formik.errors.imageAlt && (
          <small className="text-danger">{formik.errors.imageAlt}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="state"
          placeholder="state"
          name="state"
          value={formik.values.state}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="state">state</label>
        {formik.touched.state && formik.errors.state && (
          <small className="text-danger">{formik.errors.state}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="country"
          placeholder="country"
          name="country"
          value={formik.values.country}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="country">country</label>
        {formik.touched.country && formik.errors.country && (
          <small className="text-danger">{formik.errors.country}</small>
        )}
      </div>
      <div className="form-floating mb-3">
        <input
          type="text"
          className="form-control"
          id="city"
          placeholder="City"
          name="city"
          value={formik.values.city}
          onChange={formik.handleChange}
          onBlur={formik.handleBlur}
        />
        <label htmlFor="city">City</label>
        {formik.touched.city && formik.errors.city && (
          <small className="text-danger">{formik.errors.city}</small>
        )}
      </div>
    </>
  );
};

export default Register;
